import React, { Component } from "react";
import { TextField, Grid } from "@material-ui/core";

export class Login extends Component {
  render() {
    return (
      <div>
        <Grid
          className="mt-2"
          container
          spacing={3}
          justify="center"
          alignItems="center"
        >
          <Grid item xs={6}>
            <TextField
              id="outlined-full-width"
              label="Label"
              style={{ margin: 8 }}
              placeholder="Placeholder"
              helperText="Full width!"
              fullWidth
              margin="normal"
              InputLabelProps={{
                shrink: true,
              }}
              variant="outlined"
            />
          </Grid>
        </Grid>
      </div>
    );
  }
}

export default Login;
